INSERT INTO `properties` (`propid`, `lid`, `pname`, `paddress`, `pmaplink`, `pmobile`, `pdescription`, `pprice`) VALUES
(4, 2, 'Green Village', 'No. 63/4, Homagama', '6.82679032215795, 80.03363467791118', '0719208720', 'Green Village Hostel offers cozy accommodations amidst serene surroundings. Our clean and comfortable rooms provide a peaceful retreat for students, faculty, and visitors. With easy access to campus and nearby attractions, enjoy convenience and tranquility during your stay. Experience warm hospitality and the beauty of nature at Green Village Hostel. Book your stay today!', 5000),
(6, 2, 'Green Hostel', 'No 87, School junction, Homagama', '6.825586172951601, 80.0296234864952', '0775325158', 'Situated in proximity to NSBM Green University in Pitipana, Homagama, Green Hostel offers tailored accommodations exclusively for male guests. Our hostel provides a tranquil refuge amidst verdant landscapes, ensuring a restful stay for students and professionals alike. With convenient access to campus facilities and nearby amenities, enjoy a seamless blend of comfort and convenience during your time with us. Experience unparalleled hospitality and a serene environment at Green Hostel. Book your stay now for an unparalleled experience tailored for men.', 7500),
(7, 3, 'Saptara Luxury Girls Hostel', '29/1/17, Homagama 10200', '6.826413846281758, 80.0344526788226', '0716900881', 'Nestled in the heart of Pitipana, Homagama, Saptara Luxury Girls Hostel offers a haven of comfort and sophistication exclusively for female residents. Our hostel boasts luxurious accommodations amidst serene surroundings, providing a peaceful retreat for students and working professionals alike. With state-of-the-art amenities and personalized services, we ensure an unparalleled living experience for our guests. Enjoy convenient access to NSBM Green University and nearby attractions while indulging in the warmth of our hospitality. Experience the epitome of luxury living at Saptara Luxury Girls Hostel. Book your stay today for an unforgettable experience tailored for women.', 8000),
(9, 3, 'FIRST CLASS Hostel', '25/3 Godahena Road, Homagama 10200', '6.826148354066693, 80.03657354956934', '0740245677', 'Welcome to our \"First Class\" Hostel, designed exclusively for NSBM girl students. Located in Pitipana, Homagama, our hostel offers luxurious accommodations and easy access to campus. Experience comfort and convenience like never before. Book your stay now!', 8000),
(10, 4, 'Bodima NSBM Sandya\r\n', '117/2/B, Homagama', '6.823386648370219, 80.02933633107142', '0713980960', 'Nestled in the vibrant community surrounding NSBM Green University, Bodima NSBM Sandya offers a welcoming retreat for students seeking comfort and convenience. With cozy accommodations and a friendly atmosphere, our hostel provides a supportive environment for your academic journey. Experience the warmth of camaraderie and the convenience of campus proximity at Bodima NSBM Sandya.', 5500),
(11, 4, 'NSBM Private Hostel\r\n', '113/7, Homagama', '6.821741666073998, 80.02828359131722', '0778682882', 'NSBM Private Hostel provides a comfortable and secure living environment for students attending NSBM Green University. With its convenient location near campus, residents enjoy easy access to academic facilities and resources. The hostel offers modern amenities, ensuring a pleasant stay, while its dedicated staff prioritize the well-being and satisfaction of every resident. Whether studying or socializing, NSBM Private Hostel fosters a supportive community atmosphere, enriching the university experience for its residents.', 6000),
(12, 6, 'Wele Kade Hostel Complex\r\n', '216, Homagama', '6.831697869563027, 80.03101945556983', '0714712715', 'Located near NSBM Green University, Wele Kade Hostel Complex offers comfortable accommodations tailored to the needs of students. With its convenient location and modern amenities, including study areas and recreational facilities, residents can enjoy a balanced lifestyle. The hostel\'s welcoming atmosphere and supportive community make it an ideal place for students to thrive academically and socially. Experience the warmth of home at Wele Kade Hostel Complex, where every resident is valued and cared for.', 6000);

